# Solution to Question 1
import re

def get_intelligence(text):
    # Use regular expressions to extract the intelligence from the text
    pattern = r'\b([a-zA-Z]{2,})\s*(\w+)\s+(\w+)\s+(\w+)'
    match = re.search(pattern,text)

    # Check if a match is found
    if not match:
        return None
    else:
        intelligence = {
            'Benjamin': {
                'name': match.group(1),
                'statement': match.group(3)
            },
            'Emily': {
                'name': match.group(1),
                'statement': match.group(3)
            }
        }

        # Check if the person has a statement about information security compliance
        if intelligence['Benjamin']['statement'] == 'The individual expressed their plan to safeguard the digital assets of their company.':
            return intelligence['Benjamin']['name']
        elif intelligence['Emily']['statement'] == 'Creating our own path, refusing to conform to society's standards and limitations.':
            return intelligence['Emily']['name']

    # If no match is found, return None
    return None
