# Define a function to evaluate the level of compliance with security policies for each person
def evaluate_compliance(name1, comments1, name2, comments2):
    # Create variables to store the risk levels
    risk_level_olivia = 0
    risk_level_chloe = 0

    # Count the number of times a risky behavior is mentioned for each person
    for comment in comments1:
        if "access personal information" in comment:
            risk_level_olivia += 1
        elif "disregard cybersecurity rules" in comment:
            risk_level_olivia += 2

    for comment in comments2:
        if "access personal information" in comment:
            risk_level_chloe += 1
        elif "disregard cybersecurity rules" in comment:
            risk_level_chloe += 2

    # Determine the person with higher risk level as less compliant
    if risk_level_olivia > risk_level_chloe:
        print(f"{name1} is LESS compliant with information security policies.")
    elif risk_level_olivia < risk_level_chloe:
        print(f"{name2} is LESS compliant with information security policies.")
    else:
        print("It is impossible to tell who is LESS compliant.")
